function buscaUniver(e){
    document.querySelector("#universidades").innerHTML = '';
    var universidades_select = document.querySelector("#universidades");
 
    var num_estados = json_univer.estados.length;
    var j_index = -1;
 
    // aqui eu pego o index do Estado dentro do JSON
    for(var x=0;x<num_estados;x++){
       if(json_univer.estados[x].sigla == e){
          j_index = x;
       }
    }
 
    if(j_index != -1){
   
       // aqui eu percorro todas as cidades e crio os OPTIONS
       json_univer.estados[j_index].universidades.forEach(function(universidades){
          var uni_opts = document.createElement('option');
          uni_opts.setAttribute('value',universidades)
          uni_opts.innerHTML = universidades;
          universidades_select.appendChild(uni_opts);
       });
    }else{
       document.querySelector("#universidades").innerHTML = '';
    }
}

function ordenar() {
    var itensOrdenados = $('#universidades option').sort(function (a, b) {
        return a.text < b.text ? -1 : 1;
    });

    $('#universidades').html(itensOrdenados);
}